import React, { useState, useEffect } from 'react'

export default function Pokedex() {
  const [pokemons, setPokemon] = useState([]);

  useEffect(() => {
    fetch(`https://pokeapi.co/api/v2/pokemon/`)
      .then(res => res.json())
      .then(data => setPokemon(data));

  }, []);

  return (
    <div>
      <h2>Lista de Pokemons</h2>
      <ul>
        {pokemons.map(poke => (
          <li key={poke.id}>
            {poke.name} 
          </li>
        ))}
      </ul>
    </div>
  );

}
